import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [form, setForm] = useState({ name: '', fatherName: '', mobileNumber: '' });
  const [data, setData] = useState([]);
  const [editId, setEditId] = useState(null); // track edit mode

  const API_URL = 'http://localhost:4000/';

  useEffect(() => {
    const fetchData = async () => {
      const res = await axios.get(API_URL + 'fetchData');
      setData(res.data);
    };
    fetchData();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (editId) {
      // Update existing
      const res = await axios.put(`${API_URL}edit/${editId}`, form);
      const updated = data.map((item) => (item._id === editId ? res.data : item));
      setData(updated);
      setEditId(null); // exit edit mode
    } else {
      // Create new
      const res = await axios.post(API_URL + 'save', form);
      setData([...data, res.data]);
    }

    // Clear form
    setForm({ name: '', fatherName: '', mobileNumber: '' });
  };

  const handleDelete = async (id) => {
    await axios.delete(`${API_URL}delete/${id}`);
    setData(data.filter((item) => item._id !== id));
  };

  const handleFill = (item) => {
    setForm({
      name: item.name,
      fatherName: item.fatherName,
      mobileNumber: item.mobileNumber,
    });
    setEditId(item._id);
  };

  return (
    <div style={{ textAlign: 'center' }}>
      <h2>{editId ? 'Update Form' : 'Registration Form'}</h2>
      <form onSubmit={handleSubmit}>
        Name: <input type="text" placeholder="Enter The Name" onChange={handleChange} name="name" value={form.name} /><br />
        Father Name: <input type="text" placeholder="Enter The Father Name" onChange={handleChange} name="fatherName" value={form.fatherName} /><br />
        Mobile Number: <input type="text" placeholder="Enter The Mobile Number" onChange={handleChange} name="mobileNumber" value={form.mobileNumber} /><br />
        <button type="submit">{editId ? 'Update' : 'Submit'}</button>
      </form>

      <h1>Display Details</h1>
      <hr />
      <center>
        <table border="1" width="600px" cellSpacing="0">
          <thead>
            <tr>
              <th>Name</th>
              <th>Father Name</th>
              <th>Mobile Number</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item._id}>
                <td>{item.name}</td>
                <td>{item.fatherName}</td>
                <td>{item.mobileNumber}</td>
                <td>
                  <button onClick={() => handleDelete(item._id)}>Delete</button>{' '}
                  <button onClick={() => handleFill(item)}>Edit</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </center>
    </div>
  );
};

export default App;
